import React from 'react'


const Table = ({ itemsProducts }) => {

  const itemsResult = itemsProducts.map((item) => {

    let classPublish = "";
    if (item.publish === "منشور") {
      classPublish = "published";
    } else {
      classPublish = "closed";
    }

    return <tr key={item.id}>
      <td><input type="checkbox" /></td>
      <td>{item.product}</td>
      <td>{item.name}</td>
      <td>{item.codeP}</td>
      <td>{item.Qt}</td>
      <td>{item.price}</td>
      <td>
        <span className={classPublish}>
          {item.publish}
        </span>
      </td>
      <td>
        <div className='procedure'>
          <i className="fa-solid fa-ellipsis-vertical"></i>
        </div>
      </td>
    </tr>
  })

  return (
    <div style={{ overflow: "auto" }}>
      <table className={`table-dashboard`} >
        <thead>
          <tr>
            <th><input type="checkbox" /></th>
            <th>المنتج</th>
            <th>الاسم</th>
            <th>رمز المنتج</th>
            <th>الكمية</th>
            <th>السعر</th>
            <th>النشر على المتجر</th>
            <th>اجراءات</th>
          </tr>
        </thead>
        <tbody>
          {itemsResult}
        </tbody>
      </table>
    </div>
  )
}

export default Table;
